import React from 'react';
import { useDispatch } from 'react-redux'

const Logout = () => {
	const dispatch = useDispatch();

	const handleSubmit = () => {
		dispatch(logout());
	}
	return (
		<div>
			<Button variant="contained" color="primary">Logout</Button>
		</div>
	)
};
export default Logout;
